import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Button from "react-bootstrap/Button";
import { Container, Row, Col } from "react-bootstrap";
import "./App.css";

class App extends Component {
  render() {
    return (
      <Container fluid className="head">
        <Row>
          <Col md={12}>
            <div className="main">
              <h1>Get Your Loan Report & Score Now</h1>
              <h3>With Loan analysis and monthly updates</h3>
              <hr></hr>
              <input type="text" placeholder="Enter Account Number"></input>
              <input type="text" placeholder="Pan Card Number" maxLength="10"></input>
              <input type="text" placeholder="Aadhaar Number" maxLength="12"></input>
              <br></br>
              <button className="uploadbtn"> 3 Month Bank Receipt</button>
              <input type="file" className="upload"></input>
              <br></br>
              <Button type="submit" className="Button">
                Submit
              </Button>
            </div>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default App;
